import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
  root: {

    maxWidth: '100%',
    maxHeight: '90%',
  },
  media: {
    height: 250,
    paddingTop: '56.25%',
  },
  cardActions: {
    flex: 1,
    justifyContent: 'flex-end',
    marginTop: 'auto'
  },
  cardContent: {
    display: 'flex',
    justifyContent: 'space-between',
  },
}));
